import './App.css';
import { Router, Route } from 'react-router-dom';
import Calculate from './components/Calculate';

function App() {
  return (
    <>
    <div>{Calculate()}</div>
    <Router>
      <Route path='/' element={<Calculate/>}/>
    </Router>
    </>
  );
}

export default App;
